 Fit In:- Will print your file INTO the paper size chosen. All of file will be within the paper size. If file shape and paper shape are not the same then white borders will result.  </p>\n<p><strong>Fill In:</strong>- Will print your file ONTO the paper size chosen. If file shape is not the same as paper size chosen the file is sized up or down so there is no unprinted paper showing. This means that your file will be cropped. If you have people close to an edge or heads near the top they may well be cropped out.  </p>\n<p><strong>No Resize:</strong>- Check you file size in Photoshop for instance. It may be something like 18in x 12in. If you select this to be printed as a 6x4in print “no resize” then only the 6x4in portion of that entire file will be printed. This instruction can be used if you are compiling the file which may have borders or effects and you know to make the finished file the size of the print required (at 300dpi).</p>\n<p><strong>Aspect Ratio Compatible Print Sizes</strong> for 3:2 are 6x4, 5x7.5, 6x9, 8x12, 10x15, 12x18.</p>\n<h3>Pearl Metallic Paper</h3>\n<p>Pearl Metallic is a great vibrant display medium and adds considerable dimension and \"wow\" factor to any print. Often used for gallery presentations, portfolios and advertising panels, not to mention wedding enlargements. We supply this in all sizes. This specialist paper is the Fuji equivalent to Kodak metallic and has the added advantage of having good whites. For further information click here.</p>\n<h3>Payment</h3>\n<p>Our preferred payment option is Direct Credit, however we can process credit cards or you can send your order on a CD along with a cheque.</p>\n<h3>Service Times</h3>\n<p>Normally 1 - 3 days, or by arrangement. Rush rates available on request.</p>&nbsp;', 'Information', '', 'publish', 'closed', 'closed', '', 'information', '', '', '2022-04-21 21:52:35', '2022-04-21 09:52:35', '', 0, 'https://ezyLocal:8890/?page_id=1598', 30, 'page', '', 0),
(1600, 1, '2022-04-21 21:53:12', '2022-04-21 09:53:12', '<h1>Prices</h1><p>Our pricing is based on quantity - the more of <strong><i>one</i></strong> size and kind you are having printing, the cheaper the prints will be.</p><h4>If you have a volume in any size please phone for price, we can probably improve on any other quote.</h4><p>Please note the standard printing mode is \"fit in\" so none of your file is cropped out. You can choose to select either \"fill in\", or \"no resize\".<br /><br /><br />All prices are in New Zealand Dollars.</p>		\n                <table data-id=\"3b3c9a7\"><thead><tr><th>Size</th><th>Finish</th><th>1</th><th>2-10</th><th>11-30</th><th>31+</th></tr></thead><tbody><tr><td>5x7.5</td><td>Lustre</td><td>$1.45</td><td>$1.30</td><td>$1.00</td><td>$0.95</td></tr><tr><td>5x7.5</td><td>Pearl</td><td>$5.50</td><td>$5.00</td><td>$4.50</td><td>$4.00</td></tr><tr><td>7x5</td><td>Lustre</td><td>$1.20</td><td>$1.20</td><td>$0.95</td><td>$0.80</td></tr><tr><td>7x5</td><td>Pearl</td><td>$5.00</td><td>$5.00</td><td>$4.50</td><td>$4.00</td></tr><tr><td>8x6</td><td>Lustre</td><td>$2.80</td><td>$2.80</td><td>$2.50</td><td>$2.00</td></tr><tr><td>8x6</td><td>Pearl</td><td>$6.00</td><td>$6.00</td><td>$5.50</td><td>$5.00</td></tr><tr><td>8x12</td><td>Lustre</td><td>$6.00</td><td>$5.50</td><td>$5.00</td><td>$4.50</td></tr><tr><td>8x12</td><td>Pearl</td><td>$9.50</td><td>$8.50</td><td>$7.50</td><td>$7.00</td></tr><tr><td>9x6</td><td>Lustre</td><td>$2.80</td><td>$2.80</td><td>$2.50</td><td>$2.00</td></tr><tr><td>9x6</td><td>Pearl</td><td>$6.00</td><td>$6.00</td><td>$6.50</td><td>$6.00</td></tr><tr><td>10x8</td><td>Lustre</td><td>$5.90</td><td>$5.50</td><td>$4.50</td><td>$3.00</td></tr><tr><td>10x8 </td><td>Pearl</td><td>$7.20</td><td>$7.20</td><td>$6.50</td><td>$6.00</td></tr><tr><td>10x8</td><td>Laminated</td><td>$8.90</td><td>$7.50</td><td>$5.40</td><td>$4.25</td></tr><tr><td>10x12</td><td>Lustre</td><td>$10.50</td><td>$10.50</td><td>$9.00</td><td>$6.50</td></t