(1602, 1, '2022-04-21 21:53:37', '2022-04-21 09:53:37', '<style>/*! elementor - v3.6.5 - 27-04-2022 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h1>Tips</h1>		\n		<p>Some simple tips to help you get the results you want from your digital prints.</p><h3>1. Calibrate your monitor.</h3><p><strong>When your monitor is calibrated, your prints will look close to what you see on your screen.</strong> <br />There are a number of inexpensive monitor calibrators readily available, see your photographic retailer.</p><p><strong>We strongly recommend that you keep your monitor calibrated.</strong> <br />You will also have to make sure that the application that you use to view and alter your work is using this calibrated monitor profile.</p><h3>2. File preparation for transmission.</h3><p>Please ensure that you send a file that is correctly sized. File should be the actual dimensions of the print size required by 300 dpi. and then saved as a jpeg file. Colour space must be sRGB. If you have concerns about quality talk to us. The site will accept large files if required.</p><h3>3 File Types</h3><p>Your file must be a jpeg or tiff (.tiff or .tif) of a size appropriate to the print size you want. Files must be flattened in sRGB mode. It\'s over to you to size a file correctly.</p><p>6x4 or other bulk print orders assume all files are the same size and with correct aspect ratio.</p><p>Please note if the shape of your file does not match the shape of the print size ordered, the print will be made \"fit in\" so none of your file is cropped out.</p><h4><strong>Charges additional</strong></h4><p>You may be charged an additional $5.00 per file if they are not set up properly (ie. incorrect colour space, resizing). If you are not sure about any of this please <a href=\"https://vinesonline.co.nz/contact/\">contact us.</a></p><h4><strong>Custom File Preparation</strong></h4><p>This is available on request at an additional charge. Please <a href=\"https://vinesonline.co.nz/contact/\">contact us.</a></p>', 'Tips', '', 'publish', 'closed', 'closed', '', 'tips', '', '', '2022-04-21 21:53:37', '2022-04-21 09:53:37', '', 0, 'https://ezyLocal:8890/?page_id=1602', 50, 'page', '', 0),
(1604, 1, '2022-04-21 21:54:55', '2022-04-21 09:54:55', '<style>/*! elementor - v3.6.4 - 13-04-2022 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h1>Delivery Information</h1>		\n		<p><strong>Standard NZ Post service</strong><br />1 - 3 Days up to A4 envelope Post &amp; Packing - $4.50</p><p><strong>Courier Local</strong><br />Wellington Area - Whitby/Upper Hutt - $7.00</p><p><strong>Courier - Rest of North Island</strong><br />(excluding Waiheke Island) - $13.00</p><p><strong>Courier - Waiheke Island</strong><br />$26.00</p><p><strong>Courier - South Island</strong><br />$20.00</p><p><strong>Saturday Delivery (Extra Charge</strong>)<br />$5.00</p><p><strong>Rural Delivery (Extra Charge)</strong><br />$4.50</p><p>All photos will be sent by courier except envelopes up to 10x8 size. Delivery options include all packaging costs.</p><p>Courier delivery is overnight. We take care when packaging prints to protect your order from damage during delivery.</p><p><strong>Please note:</strong> For Rural Delivery or for Saturday Delivery please check the required boxes on the order page. Thank you.</p>', 'Delivery Options', '', 'publish', 'closed', 'closed', '', 'delivery-options', '', '', '2022-04-21 21:54:55', '2022-04-21 09:54:55', '', 0, 'https://ezyLocal:8890/?page_id=1604', 70, 'page', '', 0),
