(2666, 1, '2023-02-14 02:47:27', '2023-02-14 02:47:27', '<style>/*! elementor - v3.6.5 - 27-04-2022 */\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style>												<img width=\"800\" height=\"211\" src=\"https://ezyLocal:8890/wp-content/uploads/2022/05/Welcome-panel.jpg\" alt=\"\" loading=\"lazy\" srcset=\"https://ezyLocal:8890/wp-content/uploads/2022/05/Welcome-panel.jpg 870w, https://ezyLocal:8890/wp-content/uploads/2022/05/Welcome-panel-300x79.jpg 300w, https://ezyLocal:8890/wp-content/uploads/2022/05/Welcome-panel-768x203.jpg 768w\" sizes=\"(max-width: 800px) 100vw, 800px\" />															\n		<h3>At Ezyprints our goal is to make printing your photos easy.</h3><p>  High-quality, low or high volume digital photo printing has never been easier with Ezyprints. Our aim is to provide the finest quality photographic prints on <i>Real Photographic Paper</i> for the professional, commercial and home photographer - all at the best possible price.</p><p>From 6x4’s to Panorama prints.</p><p>Our range of <i>Fuji Crystal Archive</i> photographic papers include Lustre, Gloss and some Supreme sizes. Prints can also be laminated – particularly handy for the dedicated school or sports team photographer!</p>', 'Home', '', 'inherit', 'closed', 'closed', '', '17-revision-v1', '', '', '2023-02-14 02:47:27', '2023-02-14 02:47:27', '', 17, 'https://ezyLocal:8890/?p=2666', 0, 'revision', '', 0),
