(41, 2650, '_elementor_data', '[{\"id\":\"229943ef\",\"elType\":\"section\",\"settings\":{\"hover_parallax\":[{\"layer_position_vr\":{\"unit\":\"%\",\"size\":30},\"layer_position_hr\":{\"unit\":\"%\",\"size\":40},\"_id\":\"d5f78df\"},{\"layer_position_vr\":{\"unit\":\"%\",\"size\":60},\"layer_position_hr\":{\"unit\":\"%\",\"size\":20},\"_id\":\"7e868bd\"}]},\"elements\":[{\"id\":\"1e0946d8\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"38b0939d\",\"elType\":\"widget\",\"settings\":{\"title\":\"Privacy Policy\",\"header_size\":\"h1\",\"align\":\"left\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Roboto\",\"typography_font_size\":{\"unit\":\"px\",\"size\":40,\"sizes\":[]},\"typography_font_weight\":\"600\",\"typography_line_height\":{\"unit\":\"em\",\"size\":1.2,\"sizes\":[]},\"_margin\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false},\"__globals__\":{\"title_color\":\"globals\\/colors?id=primary\"}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"427493f9\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<div id=\\\"content\\\">\\n<h3>Our commitment to privacy<\\/h3>\\n<p>Your privacy is important to us. To better protect your privacy we provide this notice explaining our online information practices and the choices you can make about the way your information is collected and used. To make this notice easy to find, we make it available on our homepage and at every point where personally identifiable information may be requested.<\\/p>\\n<h3>The information we collect:<\\/h3>\\n<p>This notice applies to all information collected or submitted on this website. On some pages, you may be able to order products, make requests, and register to receive materials. The types of personal information collected at these pages are:<\\/p>\\n<p style=\\\"padding-left: 40px;\\\">Name<br>Web address<br>Club name<br>Email address<br>Phone number<\\/p>\\n<h3>The information we DON\\u2019T collect:<\\/h3>\\n<p>Credit\\/Debit Card Information.<\\/p>\\n<h3>The way we use information:<\\/h3>\\n<p>We use the information you provide about yourself when placing an order only to complete that order. We do not share this information with outside parties except to the extent necessary to complete that order.<\\/p>\\n<p>We use the information you provide about someone else when placing an order only to ship the product and to confirm delivery. We do not share this information with outside parties except to the extent necessary to complete that order.<\\/p>\\n<p>We use return email addresses to answer the email we receive. Such addresses are not used for any other purpose and are not shared with outside parties.<\\/p>\\n<p>Finally, we never use or share the personally identifiable information provided to us online in ways unrelated to the ones described above without also providing you an opportunity to opt-out or otherwise prohibit such unrelated uses.<\\/p>\\n<h3>Our commitment to data security<\\/h3>\\n<p>To prevent unauthorized access, maintain data accuracy, and ensure the correct use of information, we have put in place appropriate physical, electronic, and managerial procedures to safeguard and secure the information we collect online.<\\/p>\\n<h3>How to contact us<\\/h3>\\n<p>Should you have other questions or concerns about these privacy policies, please <a href=\\\"http:\\/\\/www.lifepix.co.nz\\/contact.php\\\">contact us<\\/a>.<\\/p>\\n<\\/div>\",\"typography_typography\":\"custom\",\"typography_text_transform\":\"none\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false}]'),
