(131, 1422, '_elementor_data', '[{\"id\":\"cf4b909\",\"elType\":\"section\",\"settings\":{\"hover_parallax\":[{\"layer_position_vr\":{\"unit\":\"%\",\"size\":30},\"layer_position_hr\":{\"unit\":\"%\",\"size\":40},\"_id\":\"3ef6359\"},{\"layer_position_vr\":{\"unit\":\"%\",\"size\":60},\"layer_position_hr\":{\"unit\":\"%\",\"size\":20},\"_id\":\"a55f081\"}]},\"elements\":[{\"id\":\"8d4df25\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"a1aefda\",\"elType\":\"widget\",\"settings\":{\"title\":\"Terms of service\",\"header_size\":\"h1\",\"align\":\"left\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Roboto\",\"typography_font_size\":{\"unit\":\"px\",\"size\":40,\"sizes\":[]},\"typography_font_weight\":\"600\",\"typography_line_height\":{\"unit\":\"em\",\"size\":1.2,\"sizes\":[]},\"_margin\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false},\"__globals__\":{\"title_color\":\"globals\\/colors?id=primary\"}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"0255b0c\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<div id=\\\"stickyFooter\\\"><div class=\\\"container\\\"><div class=\\\"header clearfix\\\"><div id=\\\"nav\\\" class=\\\"clearfix\\\">\\u00a0<\\/div><\\/div><div id=\\\"content\\\"><h3>1. Introduction<\\/h3><p>The Website Owner, including subsidiaries and affiliates (\\\"Website\\\" or \\\"Website Owner\\\" or \\\"we\\\" or \\\"us\\\" or \\\"our\\\") provides the information contained on this website or any of the pages comprising the website (\\\"website\\\") to visitors (\\\"visitors\\\") (cumulatively referred to as \\\"you\\\" or \\\"your\\\" hereinafter) subject to the terms and conditions set out in these website terms and conditions, the <a href=\\\"https:\\/\\/vinesonline.co.nz\\/?page_id=3\\\">privacy policy<\\/a> and any other relevant terms and conditions, policies and notices which may be applicable to a specific sect