 be created from any website controlled by you or otherwise to this website without the express prior written permission of the Website Owner.<br \\/>Please <a href=\\\"http:\\/\\/www.lifepix.co.nz\\/contact.php\\\">contact us<\\/a> if you would like to link to this website or would like to request a link to your website.<\\/p><h3>5. Public forums and user submissions<\\/h3><p>The Website Owner is not responsible for any material submitted to the public areas by you (which include bulletin boards, hosted pages, chat rooms, or any other public area found on the website. Any material (whether submitted by you or any other user) is not endorsed, reviewed or approved by the Website Owner. The Website Owner reserves the right to remove any material submitted or posted by you in the public areas, without notice to you, if it becomes aware and determines, in its sole and absolute discretion that you are or there is the likelihood that you may, including but not limited to -<\\/p><p style=\\\"padding-left: 40px;\\\"><b>5.1<\\/b> Defame, abuse, harass, stalk, threaten or otherwise violate the rights of other users or any third parties;<\\/p><p style=\\\"padding-left: 40px;\\\"><b>5.2<\\/b> Publish, post, distribute or disseminate any defamatory, obscene, indecent or unlawful material or information;<\\/p><p style=\\\"padding-left: 40px;\\\"><b>5.3<\\/b> Post or upload files that contain viruses, corrupted files or any other similar software or programs that may damage the operation of the Website Owner\\u2019s and\\/or a third party\\u2019s computer system and\\/or network;<\\/p><p style=\\\"padding-left: 40px;\\\"><b>5.4<\\/b> Violate any copyright, trade mark, other applicable <b>New Zealand<\\/b> or international laws or intellectual property rights of the Website Owner or any other third party;<\\/p><p style=\\\"padding-left: 40px;\\\"><b>5.5<\\/b> Submit contents containing marketing or promotional material which is intended to solicit business.<\\/p><h3>6. Specific Use