f non-performance or interruption, or termination thereof.<\\/p><h3>9. Use of the website.<\\/h3><p>The Website Owner does not make any warranty or representation that information on the website is appropriate for use in any jurisdiction (other than <b>New Zealand<\\/b> ). By accessing the website, you warrant and represent to the Website Owner that you are legally entitled to do so and to make use of information made available via the website.<\\/p><h3>10. General<\\/h3><\\/div><\\/div><\\/div>\"},\"elements\":[],\"widgetType\":\"text-editor\"},{\"id\":\"d8306b6\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<h4>10.1 Entire Agreement.<\\/h4><p>These website terms and conditions constitute the sole record of the agreement between you and the Website Owner in relation to your use of the website. Neither you nor the Website Owner shall be bound by any express tacit or implied representation, warranty, promise or the like not recorded herein. Unless otherwise specifically stated these website terms and conditions supersede and replace all prior commitments, undertakings or representations, whether written or oral, between you and the Website Owner in respect of your use of the website.<\\/p><h4>10.2 Alteration<\\/h4><p>The Website Owner may at any time modify any relevant terms and conditions, policies or notices. You acknowledge that by visiting the website from time to time, you shall become bound to the current version of the relevant terms and conditions (the \\\"current version\\\") and, unless stated in the current version, all previous versions shall be superseded by the current version. You shall be responsible for reviewing the then current version each time you visit the website.<\\/p><h4>10.3 Conflict.<\\/h4><p>Where any conflict or contradiction appears between the provisions of these website terms and conditions and any other relevant terms and conditions, policies or notices, the other relevant terms and conditions, policies or notices which relate specifically to a particular section or module of the website shall prevail in respect of your use of the relevant section or module of the website.<\\/p><h4>10.4 Waiver.<\\/h4><p>No indulgence or extension of time which either you or the Website Owner may grant to the other will constitute a waiver of or, whether by estoppel or otherwise, limit any of the existing or future rights of the grantor in terms hereof, save in the event or to the extent that the grantor has signed a written document expressly waiving or limiting such rights.<\\/p><h4>10.5 Cession.<\\/h4><p>The Website Owner shall be entitled to cede, assign and delegate all or any of its rights and obligations in terms of any relevant terms and conditions, policies and notices to any third party.<\\/p><h4>10.6 Severability.<\\/h4><p>All provisions of any relevant terms and conditions, policies and notices are, notwithstanding the manner in which they have been grouped together or linked grammatically, severable from each other. Any provision of any relevant terms and conditions, policies and notices, which is or becomes unenforceable in any jurisdiction, whether due to voidness, invalidity, illegality, unlawfulness or for any reason whatever, shall, in such jurisdiction only and only to the extent that it is so unenforceable, be treated as pro non scripto and the remaining provisions of any relevant terms and conditions, policies and notices shall remain in full force and effect.<\\/p><h4>10.7 Applicable laws.<\\/h4><p>Any relevant terms and conditions, policies and notices shall be governed by and construed in accordance with the laws of <b>New Zealand<\\/b> without giving effect to any principles of conflict of law. You hereby consent to the exclusive jurisdiction of the High Court of <b>New Zealand<\\/b> in respect of any disputes arising in connection with the website, or any relevant terms and conditions, policies and notices or any matter related to or in connection therewith.<\\/p><h4>10.8 Comments or Questions.<\\/h4><p>If you have any questions, comments or concerns arising from the website, the <a href=\\\"https:\\/\\/vinesonline.co.nz\\/?page_id=3\\\">privacy policy<\\/a> or any other relevant terms and conditions, policies and notices or the way in which we are handling your personal information please <a href=\\\"https:\\/\\/vinesonline.co.nz\\/?page_id=22\\\">contact us<\\/a>.<\\/p>\",\"_margin\":{\"unit\":\"px\",\"top\":\"-6\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false},\"_padding\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"25\",\"isLinked\":false}},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false}]'),
