(150, 1600, '_elementor_data', '[{\"id\":\"64907573\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"511e549b\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"3c68a51f\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<h1>Prices<\\/h1><p>Our pricing is based on quantity - the more of <span style=\\\"text-decoration: underline;\\\"><strong><i>one<\\/i><\\/strong><\\/span> size and kind you are having printing, the cheaper the prints will be.<\\/p><h4>If you have a volume in any size please phone for price, we can probably improve on any other quote.<\\/h4><p>Please note the standard printing mode is \\\"fit in\\\" so none of your file is cropped out. You can choose to select either \\\"fill in\\\", or \\\"no resize\\\".<br \\/><br \\/><br \\/>All prices are in New Zealand Dollars.<\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"},{\"id\":\"3b3c9a7\",\"elType\":\"widget\",\"settings\":{\"ea_adv_data_table_static_html\":\"<thead><tr><th>Size<\\/th><th>Finish<\\/th><th>1<\\/th><th>2-10<\\/th><th>11-30<\\/th><th>31+<\\/th><\\/tr><\\/thead><tbody><tr><td>5x7.5<\\/td><td>Lustre<\\/td><td>$1.45<\\/td><td>$1.30<\\/td><td>$1.00<\\/td><td>$0.95<\\/td><\\/tr><tr><td>5x7.5<\\/td><td>Pearl<\\/td><td>$5.50<\\/td><td>$5.00<\\/td><td>$4.50<\\/td><td>$4.00<\\/td><\\/tr><tr><td>7x5<\\/td><td>Lustre<\\/td><td>$1.20<\\/td><td>$1.20<\\/td><td>$0.95<\\/td><td>$0.80<\\/td><\\/tr><tr><td>7x5<\\/td><td>Pearl<\\/td><td>$5.00<\\/td><td>$5.00<\\/td><td>$4.50<\\/td><td>$4.00<\\/td><\\/tr><tr><td>8x6<\\/td><td>Lustre<\\/td><td>$2.80<\\/td><td>$2.80<\\/td><td>$2.50<\\/td><td>$2.00<\\/td><\\/tr><tr><td>8x6<\\/td><td>Pearl<\\/td><td>$6.00<\\/td><td>$6.00<\\/td><td>$5.50<\\/td><td>$5.00<\\/td><\\/tr><tr><td>8x12<\\/td><td>Lustre<\\/td><td>$6.00<\\/td><td>$5.50<\\/td><td>$5.00<\\/td><td>$4.50<\\/td><\\/tr><tr><td>8x12<\\/td><td>Pearl<\\/td><td>$9.50<\\/td><td>$8.50<\\/td><td>$7.50<\\/td><td>$7.00<\\/td><\\/tr><tr><td>9x6<\\/td><td>Lustre<\\/td