(163, 1602, '_elementor_data', '[{\"id\":\"07fcf48\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"5f0d5fd\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"edf543f\",\"elType\":\"widget\",\"settings\":{\"title\":\"Tips\",\"header_size\":\"h1\"},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"6007d41\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Some simple tips to help you get the results you want from your digital prints.<\\/p><h3>1. Calibrate your monitor.<\\/h3><p><strong>When your monitor is calibrated, your prints will look close to what you see on your screen.<\\/strong> <br \\/>There are a number of inexpensive monitor calibrators readily available, see your photographic retailer.<\\/p><p><strong>We strongly recommend that you keep your monitor calibrated.<\\/strong> <br \\/>You will also have to make sure that the application that you use to view and alter your work is using this calibrated monitor profile.<\\/p><h3>2. File preparation for transmission.<\\/h3><p>Please ensure that you send a file that is correctly sized. File should be the actual dimensions of the print size required by 300 dpi. and then saved as a jpeg file. Colour space must be sRGB. If you have concerns about quality talk to us. The site will accept large files if required.<\\/p><h3>3 File Types<\\/h3><p>Your file must be a jpeg or tiff (.tiff or .tif) of a size appropriate to the print size you want. Files must be flattened in sRGB mode. It\'s over to you to size a file correctly.<\\/p><p>6x4 or other bulk print orders assume all files are the same size and with correct aspect ratio.<\\/p><p>Please note if the shape of your file does not match the shape of the print size ordered, the print will be made \\\"fit in\\\" so none of your file is cropped out.<\\/p><h4><strong>Charges additional<\\/strong><\\/h4><p>You may be charged an additional $5.00 per file if they are not set up properly (ie. incorrect colour space, resizing). If you are not sure about any of this please <a href=\\\"https:\\/\\/vinesonline.co.nz\\/contact\\/\\\">contact us.<\\/a><\\/p><h4><strong>Custom File Preparation<\\/strong><\\/h4><p>This is available on request at an additional charge. Please <a href=\\\"https:\\/\\/vinesonline.co.nz\\/contact\\/\\\">contact us.<\\/a><\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false}]'),
