(174, 1604, '_elementor_data', '[{\"id\":\"ab5bbed\",\"elType\":\"section\",\"settings\":{\"margin\":{\"unit\":\"px\",\"top\":\"0\",\"right\":0,\"bottom\":\"0\",\"left\":0,\"isLinked\":false},\"padding\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false}},\"elements\":[{\"id\":\"8c2ae9e\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"b16b2b1\",\"elType\":\"widget\",\"settings\":{\"title\":\"Delivery Information\",\"header_size\":\"h1\",\"__globals__\":{\"title_color\":\"globals\\/colors?id=primary\"},\"_margin\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false},\"_padding\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"bca0b2f\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p><strong>Standard NZ Post service<\\/strong><br \\/>1 - 3 Days up to A4 envelope Post &amp; Packing - $4.50<\\/p><p><strong>Courier Local<\\/strong><br \\/>Wellington Area - Whitby\\/Upper Hutt - $7.00<\\/p><p><strong>Courier - Rest of North Island<\\/strong><br \\/>(excluding Waiheke Island) - $13.00<\\/p><p><strong>Courier - Waiheke Island<\\/strong><br \\/>$26.00<\\/p><p><strong>Courier - South Island<\\/strong><br \\/>$20.00<\\/p><p><strong>Saturday Delivery (Extra Charge<\\/strong>)<br \\/>$5.00<\\/p><p><strong>Rural Delivery (Extra Charge)<\\/strong><br \\/>$4.50<\\/p><p>All photos will be sent by courier except envelopes up to 10x8 size. Delivery options include all packaging costs.<\\/p><p>Courier delivery is overnight. We take care when packaging prints to protect your order from damage during delivery.<\\/p><p><strong>Please note:<\\/strong> For Rural Delivery or for Saturday Delivery please check the required boxes on the order page. Thank you.<\\/p>\",\"_margin\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false},\"_padding\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false}},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false}]'),
