(17, 1, '2022-03-09 11:33:12', '2022-03-09 11:33:12', '<style>/*! elementor - v3.13.2 - 11-05-2023 */\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style>												<img width=\"800\" height=\"211\" src=\"https://ezyLocal:8890/wp-content/uploads/2022/05/Welcome-panel.jpg\" alt=\"\" loading=\"lazy\" srcset=\"https://ezyLocal:8890/wp-content/uploads/2022/05/Welcome-panel.jpg 870w, https://ezyLocal:8890/wp-content/uploads/2022/05/Welcome-panel-300x79.jpg 300w, https://ezyLocal:8890/wp-content/uploads/2022/05/Welcome-panel-768x203.jpg 768w\" sizes=\"(max-width: 800px) 100vw, 800px\" />															\n			<style>/*! elementor - v3.13.2 - 11-05-2023 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h2>At Ezyprints our goal is to make printing your photos easy.</h2>		\n		<p>High-quality, low or high volume digital photo printing has never been easier with Ezyprints. Our aim is to provide the finest quality photographic prints on Real Photographic Paper for the professional, commercial and home photographer - all at the best possible price.</p><p>From 6x4’s to Panorama prints.</p><p>Our range of Fuji Crystal Archive photographic papers include Lustre, Gloss and some Supreme sizes. Prints can also be laminated – particularly handy for the dedicated school or sports team photographer!</p>', 'Home', '', 'publish', 'closed', 'closed', '', 'home', '', '', '2023-05-18 17:20:36', '2023-05-18 05:20:36', '', 0, 'https://ezyLocal:8890', 0, 'page', '', 0),
