omise or the like not recorded herein. Unless otherwise specifically stated these website terms and conditions supersede and replace all prior commitments, undertakings or representations, whether written or oral, between you and the Website Owner in respect of your use of the website.</p><h4>10.2 Alteration</h4><p>The Website Owner may at any time modify any relevant terms and conditions, policies or notices. You acknowledge that by visiting the website from time to time, you shall become bound to the current version of the relevant terms and conditions (the \"current version\") and, unless stated in the current version, all previous versions shall be superseded by the current version. You shall be responsible for reviewing the then current version each time you visit the website.</p><h4>10.3 Conflict.</h4><p>Where any conflict or contradiction appears between the provisions of these website terms and conditions and any other relevant terms and conditions, policies or notices, the other relevant terms and conditions, policies or notices which relate specifically to a particular section or module of the website shall prevail in respect of your use of the relevant section or module of the website.</p><h4>10.4 Waiver.</h4><p>No indulgence or extension of time which either you or the Website Owner may grant to the other will constitute a waiver of or, whether by estoppel or otherwise, limit any of the existing or future rights of the grantor in terms hereof, save in the event or to the extent that the grantor has signed a written document expressly waiving or limiting such rights.</p><h4>10.5 Cession.</h4><p>The Website Owner shall be entitled to cede, assign and delegate all or any of its rights and obligations in terms of any relevant terms and conditions, policies and notices to any third party.</p><h4>10.6 Severability.</h4><p>All provisions of any relevant terms and conditions, policies and notices are, notwithstanding the manner in which they have been grouped together or linked grammatically, severable from each other. Any provision of any relevant terms and conditions, policies and notices, which is or becomes unenforceable in any jurisdiction, whether due to voidness, invalidity, illegality, unlawfulness or for any reason whatever, shall, in such jurisdiction only and only to the extent that it is so unenforceable, be treated as pro non scripto and the remaining provisions of any relevant terms and conditions, policies and notices shall remain in full force and effect.</p><h4>10.7 Applicable laws.</h4><p>Any relevant terms and conditions, policies and notices shall be governed by and construed in accordance with the laws of <b>New Zealand</b> without giving effect to any principles of conflict of law. You hereby consent to the exclusive jurisdiction of the High Court of <b>New Zealand</b> in respect of any disputes arising in connection with the website, or any relevant terms and conditions, policies and notices or any matter related to or in connection therewith.</p><h4>10.8 Comments or Questions.</h4><p>If you have any questions, comments or concerns arising from the website, the <a href=\"https://vinesonline.co.nz/?page_id=3\">privacy policy</a> or any other relevant terms and conditions, policies and notices or the way in which we are handling your personal information please <a href=\"https://vinesonline.co.nz/?page_id=22\">contact us</a>.</p>', 'Terms of service', '', 'publish', 'closed', 'closed', '', 'terms-of-service', '', '', '2022-03-18 21:50:39', '2022-03-18 08:50:39', '', 0, 'https://ezyLocal:8890/?page_id=1422', 190, 'page', '', 0),
(1598, 1, '2022-04-21 21:52:35', '2022-04-21 09:52:35', '<style>/*! elementor - v3.6.5 - 27-04-2022 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h1>Information</h1>		\n		<h3>Site alterations</h3>\n<p>Allows for you to enter an email address and password so that you do not have to repeat your details every time you send an order.</p>\n<p>You can now indicate fill, fit, or no resize and also with or without white border.</p>\n<p>Customers with package printing arrangements will now have these prices loaded to their account and your order can be finalised in one step.</p>\n<p>(we are still in the process of loading these prices and will contact you about this)</p>\n<h3>Lab information</h3>\n<p>All Prints are Silver Halide \"real photos\" including output in the larger sizes. We print from digital files only and files are printed \"file to print\" meaning that we do not alter your file. Smaller sizes can be put through the standard Fuji \"fix it\" software if required.</p>\n<p>Prints up to 12x18 are printed on our Fuji 570 Frontier. This is a state of the art laser printer outputting what you would describe as \"best possible\".</p>\n<p>Standard paper used is Lustre, Gloss is available in 10\" paper sizes, please specify if required. Sizes shown are in inches.</p>\n<p>Larger sizes for murals or panoramas (20\") are printed on either a Kodak LEDII (Pegasus) or a Durst Epsilon. Both of these machines are highly regarded. The Epsilon is known to be used in a Museum environment for reproduction of artworks. Finished prints may be returned to you as an uncut roll to diminish handling. Please advise if you prefer cut.</p>\n<h3>Resize options</h3>\n<p><strong>Lab default is Fit In.</strong> This means that your file will not be cropped and will be sized proportionally up or down to fit the paper area chosen. If you file is not the same shape as the paper size chosen there will be a white border on two sides. INSERT INTO `wp_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
