(3082, 1, '2023-05-18 17:18:00', '2023-05-18 05:18:00', '<!-- wp:paragraph -->\n<p><style>/*! elementor - v3.12.1 - 02-04-2023 */<br />\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style></p>\n<!-- /wp:paragraph -->\n<!-- wp:image -->\n<figure><img src=\"https://ezyLocal:8890/wp-content/uploads/2022/05/Welcome-panel.jpg\" alt=\"\"/></figure>\n<!-- /wp:image -->\n<!-- wp:heading {\"level\":3} -->\n<h3>At Ezyprints our goal is to make printing your photos easy.</h3>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p>High-quality, low or high volume digital photo printing has never been easier with Ezyprints. Our aim is to provide the finest quality photographic prints on <i>Real Photographic Paper</i> for the professional, commercial and home photographer - all at the best possible price.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>From 6x4’s to Panorama prints.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Our range of <i>Fuji Crystal Archive</i> photographic papers include Lustre, Gloss and some Supreme sizes. Prints can also be laminated – particularly handy for the dedicated school or sports team photographer!</p>\n<!-- /wp:paragraph -->', 'Home', '', 'inherit', 'closed', 'closed', '', '17-revision-v1', '', '', '2023-05-18 17:18:00', '2023-05-18 05:18:00', '', 17, 'https://ezyLocal:8890/?p=3082', 0, 'revision', '', 0),
(3083, 1, '2023-05-18 17:20:35', '2023-05-18 05:20:35', '<!-- wp:paragraph -->\n<p><style>/*! elementor - v3.12.1 - 02-04-2023 */<br />\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style></p>\n<!-- /wp:paragraph -->\n<!-- wp:image -->\n<figure><img src=\"https://ezyLocal:8890/wp-content/uploads/2022/05/Welcome-panel.jpg\" alt=\"\"/></figure>\n<!-- /wp:image -->\n<!-- wp:heading {\"level\":3} -->\n<h3>At Ezyprints our goal is to make printing your photos easy.</h3>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p>High-quality, low or high volume digital photo printing has never been easier with Ezyprints. Our aim is to provide the finest quality photographic prints on <i>Real Photographic Paper</i> for the professional, commercial and home photographer - all at the best possible price.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>From 6x4’s to Panorama prints.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Our range of <i>Fuji Crystal Archive</i> photographic papers include Lustre, Gloss and some Supreme sizes. Prints can also be laminated – particularly handy for the dedicated school or sports team photographer!</p>\n<!-- /wp:paragraph -->', 'Home', '', 'inherit', 'closed', 'closed', '', '17-revision-v1', '', '', '2023-05-18 17:20:35', '2023-05-18 05:20:35', '', 17, 'https://ezyLocal:8890/?p=3083', 0, 'revision', '', 0),
(3084, 1, '2023-05-18 17:20:35', '2023-05-18 05:20:35', '<!-- wp:paragraph -->\n<p><style>/*! elementor - v3.12.1 - 02-04-2023 */<br />\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style></p>\n<!-- /wp:paragraph -->\n<!-- wp:image -->\n<figure><img src=\"https://ezyLocal:8890/wp-content/uploads/2022/05/Welcome-panel.jpg\" alt=\"\"/></figure>\n<!-- /wp:image -->\n<!-- wp:heading {\"level\":3} -->\n<h3>At Ezyprints our goal is to make printing your photos easy.</h3>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p>High-quality, low or high volume digital photo printing has never been easier with Ezyprints. Our aim is to provide the finest quality photographic prints on <i>Real Photographic Paper</i> for the professional, commercial and home photographer - all at the best possible price.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>From 6x4’s to Panorama prints.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Our range of <i>Fuji Crystal Archive</i> photographic papers include Lustre, Gloss and some Supreme sizes. Prints can also be laminated – particularly handy for the dedicated school or sports team photographer!</p>\n<!-- /wp:paragraph -->', 'Home', '', 'inherit', 'closed', 'closed', '', '17-revision-v1', '', '', '2023-05-18 17:20:35', '2023-05-18 05:20:35', '', 17, 'https://ezyLocal:8890/?p=3084', 0, 'revision', '', 0),
