(3086, 1, '2023-05-18 17:28:36', '2023-05-18 05:28:36', '<h1>Prices</h1><p>Our pricing is based on quantity - the more of <strong><i>one</i></strong> size and kind you are having printing, the cheaper the prints will be.</p><h4>If you have a volume in any size please phone for price, we can probably improve on any other quote.</h4><p>Please note the standard printing mode is \"fit in\" so none of your file is cropped out. You can choose to select either \"fill in\", or \"no resize\".<br /><br /><br />All prices are in New Zealand Dollars.</p>		\n			<table id=\"eael-data-table-31d1579\">\n			    <thead>\n			        <tr>\n									            <th id=\"\" colspan=\"\">\n														Table Header</th>\n			        				            <th id=\"\" colspan=\"\">\n														Table Header</th>\n			        				            <th id=\"\" colspan=\"\">\n														Table Header</th>\n			        				            <th id=\"\" colspan=\"\">\n														Table Header</th>\n			        				        </tr>\n			    </thead>\n			  	<tbody>\n											<tr>\n													</tr>\n			        						<tr>\n													</tr>\n			        						<tr>\n													</tr>\n			        			    </tbody>\n			</table>', 'Prices', '', 'inherit', 'closed', 'closed', '', '1600-autosave-v1', '', '', '2023-05-18 17:28:36', '2023-05-18 05:28:36', '', 1600, 'https://ezyLocal:8890/?p=3086', 0, 'revision', '', 0),
